import React from 'react';
import './about.css';
import {useEffect} from 'react';
import 'bootstrap-icons/font/bootstrap-icons.css';
import myImg from './images/about.jpg';
import myLogo from './images/logo.png';
// Imports from MUI lib


const AboutPage = () => {

    // The title will update at every refresh
    useEffect(() => {
        document.title = 'About Page';
    }, []);


    return (
        <div className='about-container'>
            <section>
                <div className="container">
                    <div className="main">
                        <div className="detail">
                            <h3>Hi, I'm</h3>
                            <h1>Kfir Tayar</h1>
                            <p>I'm a professional Web Developer. Our Main Goal to help & Satisficed the Local & Global
                                Clients by
                                web development solutions
                            </p>
                        </div>
                        <div className="images">
                            <img src={myImg} alt="" className="img-w"/>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
}
export default AboutPage;
